export function SportButton({ sport, openSport }) {
  return (
    <motion.svg
      className="svgButton"
      width="100%"
      height="100%"
      viewBox={SVG_PARAMS[sport].viewBox}
      initial="hidden"
      whileHover="visible"
      animate={(openSport === sport) ? "visible" : "hidden"}
      style={{
        cursor: "pointer",
        rotate: (SVG_PARAMS[sport].rotate) ? "180deg":"",
        scaleX: (SVG_PARAMS[sport].flip) ? "-1":"1"
      }}
    >
      <motion.path
        width="140"
        height="140"
        x="410"
        y="430"
        rx="20"
        fill="var(--navbar-bg-color)"
        stroke="var(--text-color)"
        strokeWidth={SVG_PARAMS[sport].strokeWidth}
        variants={draw}
        custom={0}
        d={SVG_PARAMS[sport].path}
      />
    </motion.svg>
  )
}